import React, { Component } from 'react';
import axios from 'axios';

const usageAPI = axios.create({
  baseURL: 'http://localhost:3000',
});

const a = usageAPI.get().then(res => {console.log(res)});

class Home extends Component{
  render(){
    return(
      <div>
        <h3>Home View</h3>
      </div>
    )
  }
};

export default Home;
